import React from "react";

// Navbar Component
function Navbar() {
    return (
      <nav style={{ display: "flex", justifyContent: "space-between", alignItems: "center", padding: "1rem", backgroundColor: "#0a112e", color: "white" }}>
        <div style={{ flex: 1, textAlign: "center", fontSize: "1.5rem", fontWeight: "bold" }}>Cognivive</div>
        <img src="/logo.jpg" alt="Logo" style={{ height: "50px" }} />
      </nav>
    );
  }

export default Navbar;
